import { initializeApp } from 'firebase/app';
import { getDatabase } from 'firebase/database';
import { getAuth } from 'firebase/auth';

const firebaseConfig = {
  apiKey: "AIzaSyB6Qv0QJ8QZQZQZQZQZQZQZQZQZQZQZQZQ",
  authDomain: "water-quality-monitor.firebaseapp.com",
  databaseURL: "https://water-quality-monitor-default-rtdb.firebaseio.com",
  projectId: "water-quality-monitor",
  storageBucket: "water-quality-monitor.appspot.com",
  messagingSenderId: "123456789012",
  appId: "1:123456789012:web:abcdefghijklmnopqrstuvwxyz"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

// Initialize Realtime Database
const database = getDatabase(app);
const auth = getAuth(app);

export { database, auth };
